import { BrowserRouter, Route, Routes } from 'react-router-dom'; // Verifique se essa importação está correta
import './App.css';
import Home from './componentes/Home';
import Create from './componentes/Create';
import Update from './componentes/Update'; // Importa o componente Update

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/create" element={<Create />} />
        <Route path="/update/:id" element={<Update />} /> {/* Rota para edição */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
